const LaCollection = () => {
  return (
    // <div className=" container lacollection">
    //   <div className="row">
    //     <div className="col-lg-6 collection1">
    //       <div>
    //
    //       </div>
    //       <div className="col-lg-6 collection"></div>
    //     </div>
    //   </div>
    // </div>
    <div className="container lamarque">
      <div className="row">
        <div className="col-lg-6 marque2">
          <h1>LA COLLECTION</h1>
          // <br />
          // <h3>Combinaison de plongée sur-mesure</h3>
          // <br />
          // <h5>Quelques mots de notre styliste</h5>
          // <br />
          //{" "}
          <p>
            // <i class="fas fa-quote-left"></i>
            // Travailler un design de combinaison en néoprène était pour moi un
            // nouveau défi. Je savais que beaucoup de femmes et d’hommes
            avaient // la sensation de ne jamais être mis en valeur par cet
            équipement. // Le challenge était évident : les combinaisons Kalypse
            doivent // sublimer les corps. // <br />
            // <br />
            // Alors… pour créer la collection femme, je me suis inspirée de //
            sportives élégantes. Exemple ? Les James Bond girls. Je me suis //
            aussi intéressée aux bijoux, aux ornements des déesses africaines //
            capables de souligner le cou, les poignets, les chevilles. // <br />
            // <br />
            // Avec l’équipe Kalypse, nous avons défini les proportions idéales
            // et conçu des découpes qui avantagent. Ensuite, j’ai dessiné, j’ai
            // travaillé les différents modèles en conjuguant les codes du monde
            // aquatique et les exigences de la mode. //{" "}
            <i class="fas fa-quote-right"></i>
            //{" "}
          </p>
          // <br />
          // <i>Nathalie Szczerbinski-Marchac</i>
        </div>
        <div className="col-lg-6 marque1"></div>
      </div>
    </div>
  );
};
export default LaCollection;
